    getAllCategories = async () => {
        return this._categories;
    };

    getCategoryById = async (id) => {
        for (let category of this._categories) {
            if (category.id === id) {
                return {success: 1, data: category};
            }
        }
        return {success: 0, message: "Category not found"};
    };

    getProductById = async (id) => {
        for (let prod of this._products) {
            if (prod.id === id) {
                return prod;
            }
        }
    };

    getAllProducts = async () => {
        return this._products;
    }

    getProductsByCategoryId = async (catId) => {
        let res = [];
        for (let product of this._products) {
            if (product.category === catId) {
                res.push(product);
            }
        }
        return {success: 1, data: res};
    };

    filterProductsByTitle = async (productTitle) => {
        productTitle = productTitle.trim().toLowerCase();
        return this._products.filter(p => p.title.toLowerCase().startsWith(productTitle));
    }

    login = async (email, password) => {
        const users = this._users.filter(p => p.email === email);
        if (users.length === 0) {
            return { "success": 0, "message": "User not found" };
        }
        const user = users[0];
        if (user.password !== password) {
            return { "success": 0, "message": "Invalid password" };
        }
        return { "success": 1, "token": user.id + "." + Date.now() };
    }


    register = async (email, password, fullname) => {
        if (this._users.filter(u => u.email === email).length >= 1) {
            return { "success": 0, "message": "Email already in use" }
        }
        const newUser = {
            id: this._users.length + 1,
            fullname: fullname,
            email: email
        };
        this._users.push(newUser);
        return { "success": 1, "message": "Registered successfully" };
    }

    search = (query) => {
        return this.filterProductsByTitle(query);
    }

    getUser = async (token) => {
        try {
            const id = Number(token.split('.')[0]);
            const issuedTime = Number(token.split('.')[1]);
            if (Date.now() - issuedTime >= 30 * 60 * 1000) {
                return { success: 0, message: "Token is expired" };
            }
            const users = this._users.filter(u => u.id === id);
            if (users.length === 0) {
                return { success: 0, message: "User not found" };
            }
            return { success: 1, data: users[0] };
        } catch (e) {
            return { success: 0, message: "Invalid token" }
        }
    }

    updateUser = async (token, userData) => {
        const res = (await this.getUser(token));
        if (!res.success) return { success: 0, message: res.message };
        const user = res.data;
        if (userData.fullname) {
            user.fullname = userData.fullname;
        }
        if (userData.email) {
            user.email = userData.email;
        }
        if (userData.oldpassword) {
            if (user.password !== userData.oldpassword) {
                return { success: 0, message: "Incorrect password" };
            }
            user.password = userData.oldpassword;
        }
        this._users = this._users.filter(u => u.id != user.id);
        this._users.push(user);
        return { success: 1, message: "Data has been changed" };
    }
